import React from "react";
import { Grid, Paper, TextField, Button, Typography } from "@material-ui/core";
import { Link } from "react-router-dom";  // Import Link from react-router-dom

const Login = () => {
  const paperStyle = { padding: 50, width: 300, margin: "150px auto" };

  const SubmitForm = (e) => {
    e.preventDefault();
    // Add your login logic here
  };

  return (
    <Grid container ="center" style={{ backgroundColor: "pink", height: "100vh" }}>
      <Paper elevation={10} style={paperStyle}>
        <form onSubmit={SubmitForm}>
          <Typography variant="h5">Login</Typography>
          <TextField label="Email" placeholder="Enter Email" fullWidth required margin="normal" />
          <TextField
            label="Password"
            placeholder="Enter Password"
            type="password"
            fullWidth
            required
            margin="normal"
          />
          <Button type="submit" variant="contained" color="primary" fullWidth>
            Login
          </Button>
        </form>
        <Typography variant="body2" style={{ marginTop: 10 }}>
          Don't have an account?
          <Link to='/signup'>Sign up</Link>  {/* Use Link from react-router-dom */}
        </Typography>
      </Paper>
    </Grid>
  );
};

export default Login;
